  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117502 includes Surface
  underway, chemical, meteorological and physical data collected from NOAA Ship MILLER
  FREEMAN in the Bering Sea, Coastal Waters of SE Alaska, Cordell Bank National Marine
  Sanctuary, Gulf of Alaska, Gulf of the Farallones National Marine Sanctuary, Monterey
  Bay National Marine Sanctuary, North Pacific Ocean and Olympic Coast National Marine
  Sanctuary from 2009-05-16 to 2010-10-08. These data include AIR-SEA DIFFERENCE -
  PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, Partial pressure
  (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity) of
  carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used
  to collect these data include Carbon dioxide (CO2) gas analyzer and Shower head
  chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese data
  were collected by Richard A. Feely and Cathy Cosca of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory as part of NOAA Ship Miller Freeman Coastal Underway
  Measurements data set. CDIAC assigned the following cruise ID(s) to this data set:
  MF0902_L1, MF0902_L2, MF0902_L3, MF0902_L4, MF0903_L3, MF0904_L2, MF0904_L3, MF1001_L1,
  MF1001_L2, MF1001_L3, MF1001_T, MF1002_L1, MF1002_L2, MF1003_L2, MF1004, MF1005_L1,
  MF1005_L2 and MF1006.nnThe Global Coastal Carbon Data Project data includes the
  bottle (discrete) and surface (underway) carbon-related measurements from coastal
  research cruises, the data from time series cruises and coastal moorings. The coastal
  regions data are very important for the understanding of carbon cycle on the continental
  margins.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
